// Initializing the imported jspdf module into an easier to use variable.
let jsPDF = jspdf.jsPDF;

/*
 * With thanks to Purush0th.
 * https://gist.github.com/Purush0th/7fe8665bbb04482a0d80
 */
(function (api, $) {
	'use strict';
	api.writeText = function (text, x, y, options) {
		options = options || {};

		var defaults = {
			align: 'left',
			width: this.internal.pageSize.width - 0.5
		}

		var settings = $.extend({}, defaults, options);

		// Get current font size
		var fontSize = this.internal.getFontSize();

		// Get the actual text's width
		/* You multiply the unit width of your string by your font size and divide
		 * by the internal scale factor. The division is necessary
		 * for the case where you use units other than 'pt' in the constructor
		 * of jsPDF.
		*/
		var txtWidth = this.getStringUnitWidth(text) * fontSize / this.internal.scaleFactor;

		if (settings.align === 'center')
			x += (settings.width - txtWidth) / 2;
		else if (settings.align === 'right')
			x += (settings.width - txtWidth);

		//default is 'left' alignment
		this.text(text, x, y);

	}

})(jsPDF.API, jQuery);

// Loading the json information into the script.
var info = json_str;

// All icons in base64.
var icons = {
    email: '',
    github: '',
    linkedin: '',
    location: ' data:image/png;base64,',
    phone: '',
    web: ''
};

// Initialising the PDF
const DOCUMENT = new jsPDF({
	orientation: "portrait",
	unit: "in",
	format: [8.5, 11]
});

function createPDF() {
	////
	// RESUME // HEADER BLOCK
	////
	// Setting up the initial top and left margins.
	var x = 0.5;
	var y = 0.5;

	// Drawing the background rectangle.
	DOCUMENT.setFillColor("#201F33");
	DOCUMENT.setDrawColor("#201F33");
	DOCUMENT.rect(0, 0, 8.5, 2.3199, 'FD');

	// Adding the information to the section.
	// RESUME // HEADER BLOCK // NAME
	let r_full_name = info.details.first_name + " " + info.details.last_name;
	DOCUMENT.setTextColor("#FFFFFF");
	DOCUMENT.setFont('Montserrat', 'bold');
	DOCUMENT.setFontSize(20);
	DOCUMENT.writeText(r_full_name, x, y);
	y += 0.426697; // Adding space for the text (0.276697in) and a spacer (0.15in)

	// RESUME // HEADER BLOCK // JOB POSITION
	DOCUMENT.setTextColor("#D74761");
	DOCUMENT.setFont('Montserrat', 'regular');
	DOCUMENT.setFontSize(14);
	DOCUMENT.writeText(info.details.position, x, y);
	y += 0.343688; // Adding space for the text (0.193688in) and a spacer (0.15in)

	// RESUME // HEADER BLOCK // SUMMARY
	DOCUMENT.setTextColor("#FFFFFF");
	DOCUMENT.setFont('Montserrat', 'regular');
	DOCUMENT.setFontSize(10);
	DOCUMENT.writeText(info.details.description, x, y);

	////
	// RESUME // CONTACT BLOCK
	////
	// Resetting margin parameters.
	x = 0.5;
	y = 2.3699;

	// Drawing the background rectangle.
	DOCUMENT.setFillColor("#383659");
	DOCUMENT.setDrawColor("#383659");
	DOCUMENT.rect(0, 2.3199, 8.5, 1.26, 'FD');

	// Filling in information for contact block.
	// RESUME // CONTACT BLOCK // EMAIL
	if (info.details.email && info.details.email !== "") {
		DOCUMENT.addImage(icons.email, 'png', x, y, 0.25, 0.25); // Adding the email icon.
		// Shifting margins to include the image.
		x += 0.35;
		y += 0.165;
		DOCUMENT.setTextColor("#FFFFFF");
		DOCUMENT.setFont('Montserrat', 'regular');
		DOCUMENT.setFontSize(10);
		DOCUMENT.writeText(info.details.email, x, y);
		// Shifting margins back for the next section.
		y += 0.285;
		x -= 0.35;
	}

	// RESUME // CONTACT BLOCK // WEBSITE
	if (info.details.website && info.details.website !== "") {
		DOCUMENT.addImage(icons.web, 'png', x, y, 0.25, 0.25); // Adding the website icon.
		// Shifting margins to include the image.
		x += 0.35;
		y += 0.165;
		DOCUMENT.setTextColor("#FFFFFF");
		DOCUMENT.setFont('Montserrat', 'regular');
		DOCUMENT.setFontSize(10);
		DOCUMENT.writeText(info.details.website, x, y);
		// Shifting margins back for the next section.
		y += 0.285;
		x -= 0.35;
	}

	// RESUME // CONTACT BLOCK // LOCATION
	if (info.details.location && info.details.location !== "") {
		DOCUMENT.addImage(icons.location, 'png', x, y, 0.25, 0.25); // Adding the location icon.
		// Shifting margins to include the image.
		x += 0.35;
		y += 0.165;
		DOCUMENT.setTextColor("#FFFFFF");
		DOCUMENT.setFont('Montserrat', 'regular');
		DOCUMENT.setFontSize(10);
		DOCUMENT.writeText(info.details.location, x, y);
		// Resetting margin for second column.
		y = 2.3699;
		x = 4.25;
	}

	// RESUME // CONTACT BLOCK // PHONE
	if (info.details.phone && info.details.phone !== "") {
		DOCUMENT.addImage(icons.phone, 'png', x, y, 0.25, 0.25); // Adding the phone icon.
		// Shifting margins to include the image.
		x += 0.35;
		y += 0.165;
		DOCUMENT.setTextColor("#FFFFFF");
		DOCUMENT.setFont('Montserrat', 'regular');
		DOCUMENT.setFontSize(10);
		DOCUMENT.writeText(info.details.phone, x, y);
		// Shifting margins back for the next section.
		x -= 0.35;
		y += 0.285;
	}
	// RESUME // CONTACT BLOCK // LINKEDIN
	if (info.details.linkedin && info.details.linkedin !== "") {
		DOCUMENT.addImage(icons.linkedin, 'png', x, y, 0.25, 0.25); // Adding the LinkedIn icon.
		// Shifting margins to include the image.
		x += 0.35;
		y += 0.195;
		DOCUMENT.setTextColor("#FFFFFF");
		DOCUMENT.setFont('Montserrat', 'regular');
		DOCUMENT.setFontSize(10);
		let r_linkedin_url = "https://www.linkedin.com/in/" + info.details.linkedin;
		DOCUMENT.textWithLink(r_linkedin_url, x, y, {url: r_linkedin_url});
		// Shifting margins back for the next section.
		y += 0.285;
		x -= 0.35;
	}

	// RESUME // CONTACT BLOCK // GITHUB
	if (info.details.github && info.details.github !== "") {
		DOCUMENT.addImage(icons.github, 'png', x, y, 0.25, 0.25); // Adding the GitHub icon.
		// Shifting margins to include the image.
		x += 0.35;
		y += 0.195;
		DOCUMENT.setTextColor("#FFFFFF");
		DOCUMENT.setFont('Montserrat', 'regular');
		DOCUMENT.setFontSize(10);
		var r_github_url = "https://www.github.com/" + info.details.github;
		DOCUMENT.textWithLink(r_github_url, x, y, {url: r_github_url});
	}

	////
	// RESUME // SKILLS
	////
	// Resetting the margins for current block.
	x = 0.5;
	y = 4.0299;
	// Setting block header.
	let r_block_header = "SKILLS & COMPETENCIES";
	if (info.skills.header) r_block_header = info.skills.header.toUpperCase();
	// Writing block header.
	DOCUMENT.setTextColor("#D74761");
	DOCUMENT.setFont('Montserrat', 'bold');
	DOCUMENT.setFontSize(14);
	DOCUMENT.writeText(r_block_header, x, y);
	y += 0.243688;
	for (var i = 0; i < info.skills.skills.length; i++) {
		// Writing skill header.
		DOCUMENT.setTextColor("#000000");
		DOCUMENT.setFont('Montserrat', 'bold');
		DOCUMENT.setFontSize(12);
		DOCUMENT.writeText(info.skills.skills[i].title, x, y);
		y += 0.166018

		// Writing details.
		DOCUMENT.setTextColor("#808080");
		DOCUMENT.setFont('Montserrat', 'regular');
		DOCUMENT.setFontSize(10);
		DOCUMENT.writeText(info.skills.skills[i].details, x, y);
		y += 0.288349;
	}

	////
	// RESUME // PROFESSIONAL EXPERIENCE
	////
	// Adding spacer.
	y += 0.15;
	// Setting block header.
	r_block_header = "PROFESSIONAL EXPERIENCE";
	if (info.experience.header) r_block_header = info.experience.header.toUpperCase();
	// Writing block header.
	DOCUMENT.setTextColor("#D74761");
	DOCUMENT.setFont('Montserrat', 'bold');
	DOCUMENT.setFontSize(14);
	DOCUMENT.writeText(r_block_header, x, y);
	y += 0.243688;

	for (var i = 0; i < info.experience.jobs.length; i++) {
		// Writing job title.
		DOCUMENT.setTextColor("#000000");
		DOCUMENT.setFont('Montserrat', 'bold');
		DOCUMENT.setFontSize(12);
		DOCUMENT.writeText(info.experience.jobs[i].title, x, y);
		y += 0.166018

		// Writing job location.
		let r_job_company = info.experience.jobs[i].company + "  " + info.experience.jobs[i].location;
		DOCUMENT.setTextColor("#000000");
		DOCUMENT.setFont('Montserrat', 'regular');
		DOCUMENT.setFontSize(10);
		DOCUMENT.writeText(r_job_company, x, y);
		y += 0.188349;

		// Writing job date.
		let r_job_date = info.experience.jobs[i].start + '  ' + info.experience.jobs[i].end;
		DOCUMENT.setTextColor("#D74761");
		DOCUMENT.setFont('Montserrat', 'regular');
		DOCUMENT.setFontSize(10);
		DOCUMENT.writeText(r_job_date, x, y);
		y += 0.238349;

		// Writing job duties.
		for (var k = 0; k < info.experience.jobs[i].description.length; k++) {
			DOCUMENT.setTextColor("#D74761");
			DOCUMENT.setFont('Montserrat', 'bold');
			DOCUMENT.setFontSize(14);
			DOCUMENT.writeText("", x, y);
			x += 0.15;

			DOCUMENT.setTextColor("#000000");
			DOCUMENT.setFont('Montserrat', 'regular');
			DOCUMENT.setFontSize(10);
			DOCUMENT.writeText(info.experience.jobs[i].description[k], x, y);
			x = 0.5
			y += 0.238349;
		}
		y += 0.1;
	}

	////
	// RESUME // EDUCATION
	////
	// Adding spacer.
	y += 0.05;
	// Setting block header.
	r_block_header = "EDUCATION";
	if (info.education.header) r_block_header = info.education.header.toUpperCase();
	// Writing block header.
	DOCUMENT.setTextColor("#D74761");
	DOCUMENT.setFont('Montserrat', 'bold');
	DOCUMENT.setFontSize(14);
	DOCUMENT.writeText(r_block_header, x, y);
	y += 0.243688;
	for (var i = 0; i < info.education.entries.length; i++){
		let r_edu_certification = info.education.entries[i].certificate + " in " + info.education.entries[i].field;
		DOCUMENT.setTextColor("#000000");
		DOCUMENT.setFont('Montserrat', 'bold');
		DOCUMENT.setFontSize(12);
		DOCUMENT.writeText(r_edu_certification, x, y);
		y += 0.166018

		let r_edu_location = info.education.entries[i].institution + "  " + info.education.entries[i].location;
		DOCUMENT.setTextColor("#000000");
		DOCUMENT.setFont('Montserrat', 'regular');
		DOCUMENT.setFontSize(10);
		DOCUMENT.writeText(r_edu_location, x, y);
		y += 0.188349;

		let r_edu_date = info.education.entries[i].start + "  " + info.education.entries[i].end;
		DOCUMENT.setTextColor("#D74761");
		DOCUMENT.setFont('Montserrat', 'regular');
		DOCUMENT.setFontSize(10);
		DOCUMENT.writeText(r_edu_date, x, y);
		y += 0.288349;
	}

	DOCUMENT.save(resume_title + ".pdf");
}